import React, { useState } from 'react';
import axios from 'axios'; // Axios for making HTTP requests
import { Button, Form, Container, Row, Col } from 'react-bootstrap';
import './doctorForm.css'; // Import the new CSS file
import { useNavigate } from 'react-router-dom';

const DoctorForm = () => {
    const [firstName, setFirstName] = useState('');
    const [lastName, setLastName] = useState('');
    const [phone, setPhone] = useState('');
    const [email, setEmail] = useState('');
    const [address, setAddress] = useState('');
    const [locality, setLocality] = useState('');
    const [age, setAge] = useState('');
    const [gender, setGender] = useState('');
    const [nationality, setNationality] = useState('');
    const [dob, setDob] = useState('');
    const [education, setEducation] = useState('');
    const [higherQualification, setHigherQualification] = useState('');

    const navigate = useNavigate();

    const handleSubmit = async (event) => {
        event.preventDefault();
        
        const formData = {
            firstName,
            lastName,
            phone,
            email,
            address,
            locality,
            age,
            gender,
            nationality,
            dob,
            education,
            higherQualification
        };

        try {
            // Send POST request to backend API
            const response = await axios.post('http://localhost:5000/doctoreg', formData);
            console.log(response.data); // Log the response from the server
            // Optionally, reset form fields after successful submission
            // setFirstName('');
            // setLastName('');
            // ...
        } catch (error) {
            console.error('Error submitting form:', error);
        }
    };

    return (
        <Container className="form-main">
            <Row className="justify-content-center">
                <Col md={8}>
                    <div className="form-header text-center">
                        <h2 className="form-logo">Care&Cure</h2>
                        <h5 className="form-title">Doctor Registration Form</h5>
                    </div>

                    <Form className="form-container" onSubmit={handleSubmit}>
                        <Form.Row>
                            <Form.Group as={Col} controlId="firstName">
                                <Form.Label>First Name *</Form.Label>
                                <Form.Control 
                                    type="text" 
                                    placeholder="Enter your first name" 
                                    value={firstName} 
                                    onChange={(e) => setFirstName(e.target.value)} 
                                />
                            </Form.Group>
                            <Form.Group as={Col} controlId="lastName">
                                <Form.Label>Last Name *</Form.Label>
                                <Form.Control 
                                    type="text" 
                                    placeholder="Enter your last name" 
                                    value={lastName} 
                                    onChange={(e) => setLastName(e.target.value)} 
                                />
                            </Form.Group>
                        </Form.Row>

                        <Form.Row>
                            <Form.Group as={Col} controlId="phone">
                                <Form.Label>Phone/Mobile *</Form.Label>
                                <Form.Control 
                                    type="text" 
                                    placeholder="Enter your phone or mobile number" 
                                    value={phone} 
                                    onChange={(e) => setPhone(e.target.value)} 
                                />
                            </Form.Group>
                            <Form.Group as={Col} controlId="email">
                                <Form.Label>Email *</Form.Label>
                                <Form.Control 
                                    type="email" 
                                    placeholder="Enter your email address" 
                                    value={email} 
                                    onChange={(e) => setEmail(e.target.value)} 
                                />
                            </Form.Group>
                        </Form.Row>

                        <Form.Row>
                            <Form.Group as={Col} controlId="address">
                                <Form.Label>Permanent Address *</Form.Label>
                                <Form.Control 
                                    type="text" 
                                    placeholder="Enter your permanent address" 
                                    value={address} 
                                    onChange={(e) => setAddress(e.target.value)} 
                                />
                            </Form.Group>
                            <Form.Group as={Col} controlId="locality">
                                <Form.Label>Locality *</Form.Label>
                                <Form.Control 
                                    type="text" 
                                    placeholder="Enter your locality" 
                                    value={locality} 
                                    onChange={(e) => setLocality(e.target.value)} 
                                />
                            </Form.Group>
                        </Form.Row>

                        <Form.Row>
                            <Form.Group as={Col} controlId="age">
                                <Form.Label>Age *</Form.Label>
                                <Form.Control 
                                    type="text" 
                                    placeholder="Enter your age" 
                                    value={age} 
                                    onChange={(e) => setAge(e.target.value)} 
                                />
                            </Form.Group>
                            <Form.Group as={Col} controlId="gender">
                                <Form.Label>Gender *</Form.Label>
                                <Form.Control 
                                    type="text" 
                                    placeholder="Enter your gender" 
                                    value={gender} 
                                    onChange={(e) => setGender(e.target.value)} 
                                />
                            </Form.Group>
                        </Form.Row>

                        <Form.Row>
                            <Form.Group as={Col} controlId="nationality">
                                <Form.Label>Nationality *</Form.Label>
                                <Form.Control 
                                    type="text" 
                                    placeholder="Enter your nationality" 
                                    value={nationality} 
                                    onChange={(e) => setNationality(e.target.value)} 
                                />
                            </Form.Group>
                            <Form.Group as={Col} controlId="dob">
                                <Form.Label>Date of Birth *</Form.Label>
                                <Form.Control 
                                    type="date" 
                                    placeholder="Enter your date of birth" 
                                    value={dob} 
                                    onChange={(e) => setDob(e.target.value)} 
                                />
                            </Form.Group>
                        </Form.Row>

                        <Form.Row>
                            <Form.Group as={Col} controlId="education">
                                <Form.Label>Educational Qualification *</Form.Label>
                                <Form.Control 
                                    type="text" 
                                    placeholder="Enter your educational qualification" 
                                    value={education} 
                                    onChange={(e) => setEducation(e.target.value)} 
                                />
                            </Form.Group>
                            <Form.Group as={Col} controlId="higherQualification">
                                <Form.Label>Higher Qualification *</Form.Label>
                                <Form.Control 
                                    type="text" 
                                    placeholder="Enter your higher qualification" 
                                    value={higherQualification} 
                                    onChange={(e) => setHigherQualification(e.target.value)} 
                                />
                            </Form.Group>
                        </Form.Row>

                        <div className="form-submit text-center mt-4">
                            
                            <Button variant="primary" type="submit" className="mr-2">Submit</Button>
                            <Button variant="success" href="/login">Login</Button>
                        </div>
                    </Form>
                </Col>
            </Row>
        </Container>
    );
};

export default DoctorForm;
